if fh ~= -1
    fprintf(fh, '%s,%s\n',...
        'P', 'f');
    fclose(fh);
end

dlmwrite(...
    plotFile,...
    [Xside4' fside4'],...
    '-append',...
    'delimiter', ',',...
    'newline', 'unix'...
);

